function initMap(){var a=new google.maps.Map(document.getElementById("map"),{center:{lat:34.0182677,lng:-118.4745879},zoom:14});restaurantLocations.forEach(function(n){n.marker=new google.maps.Marker({position:n.loc,title:n.name}),n.marker.setMap(a)})}var restaurantLocations=[{name:"Valentino Santa Monica",loc:{lat:34.026662,lng:-118.456821}},{name:"Fritto Misto",loc:{lat:34.016845,lng:-118.489952}},{name:"Mercado",loc:{lat:34.016158,lng:-118.494994}},{name:"Hillstone",loc:{lat:34.017745,lng:-118.499792}},{name:"Umami Burger",loc:{lat:34.019144,lng:-118.492336}}],viewModel=function(){this.viewableLocations=ko.observableArray(restaurantLocations)};ko.applyBindings(new viewModel);